import React from 'react'

export default function PostData({postData, setPostId}) {

    const backTofeed = () => {
        setPostId(0)
    }
    return (
        <div>
            <h1>{postData.title}</h1>
            <button onClick={backTofeed}></button>

        </div>
    )
}
